import React, { Component } from "react";
import TableComponent from "../Components/TableComponent";
import { connect } from "react-redux";
import { getBarangList } from "../Action/BarangAction";

class BarangContainer extends Component {
  componentDidMount() {
    this.props.dispatch(getBarangList());
  }
  render() {
    return (
      <div>
        <TableComponent />
      </div>
    );
  }
}

export default connect()(BarangContainer);
